# @lc app=leetcode.cn id=914 lang=python
#
# [914] 卡牌分组
#
# 解题思路
# 1、循环 + Counter
#   1.记录里面每个元素的总数量
#   2.循环从2开始一直到n，判断每个值与循环值取模=0
# 
# 2. 求最大公约数
#   1.统计每个数字的数量
#   2.计算每个数字的最大公约数在


# @lc code=start
import collections
from functools import reduce
from fractions import gcd

class Solution(object):
    def hasGroupsSizeX(self, deck):
        vals = collections.Counter(deck).values()
        # reduce将vals每个元素执行gcd
        # reduce在2.7可以直接访问
        # 在python3中要从functools引入
        # gcd在python3.要从math引入
        return reduce(gcd, vals) >= 2



